  false,\n\t\"url\": null,\n\t\"notes\": \"The present report is an extension of earlier
  data reports embodying data related to high sea salmon fishing by Canadian exploratory
  fishing vessels. The catches were made by gillnetting with nets of various mesh
  size at the positions shown in Figure 1. The period of fishing was from May 10 1958
  to August 24 1958. The catches were quick-frozen and held in cold storage boxes
  for examination at the base laboratory. In this report the length, weight, sex,
  and maturity, and stomach contents are tabulated for each of the fresh-thawed fish.
  Also, included are data for each fishing position showing gear fished, depth of
  fishing, surface temperature and salinity, and oceanographic domain.\",\n\t\"owner_org\":
